  const [tasks, setTask] = useState([]);

  useEffect(() => {
    console.log("iniciada la carga");
    // setTask(newTask);
  }, [tasks]);
  return (
    <div>
      <table>
        <theader>
          <tr>
            <th>Titulo</th>
            <th>Descripcion</th>
            <th>Prioridad</th>
            <th>Acciones</th>
          </tr>
        </theader>
        <tbody>
          {newTask.map((task, index) => {
            return <TaskComponent key={index} task={task}></TaskComponent>;
          })}
        </tbody>
      </table>
      {/* TaskComponent <Task></Task> */}
    </div>
  );
};

export default TaskListComponent;
